import React, { useState, useEffect, useRef } from 'react';
import { Link } from 'react-router-dom';
import {
  Container,
  Typography,
  Button,
  Grid,
  Card,
  CardContent,
  Box,
  Chip,
  Fade
} from '@mui/material';
import {
  MusicNote,
  Event,
  People,
  Star
} from '@mui/icons-material';
import ReviewsCarousel from '../components/ReviewsCarousel';

const CounterAnimation = ({ target, prefix = '', duration = 2000 }) => {
  const [count, setCount] = useState(0);
  const [isVisible, setIsVisible] = useState(false);
  const elementRef = useRef(null);

  useEffect(() => {
    const observer = new IntersectionObserver(
      ([entry]) => {
        if (entry.isIntersecting && !isVisible) {
          setIsVisible(true);
        }
      },
      { threshold: 0.5 }
    );

    if (elementRef.current) {
      observer.observe(elementRef.current);
    }

    return () => observer.disconnect();
  }, [isVisible]);

  useEffect(() => {
    if (!isVisible) return;

    const startTime = Date.now();
    const endTime = startTime + duration;

    const updateCount = () => {
      const now = Date.now();
      const progress = Math.min((now - startTime) / duration, 1);

      const easeOutCubic = 1 - Math.pow(1 - progress, 3);
      const currentCount = Math.floor(easeOutCubic * target);

      setCount(currentCount);

      if (now < endTime) {
        requestAnimationFrame(updateCount);
      } else {
        setCount(target);
      }
    };

    requestAnimationFrame(updateCount);
  }, [isVisible, target, duration]);

  return (
    <span ref={elementRef}>
      {prefix}{count}
    </span>
  );
};

const Home = () => {
  return (
    <>
      {/* Hero Section with Banner */}
      <Box
        className="relative flex items-center justify-center overflow-hidden"
        sx={{
          height: '100vh',
          minHeight: '800px',
          backgroundImage: 'url(/images/banner.jpg)',
          backgroundSize: 'cover',
          backgroundPosition: 'center',
          backgroundAttachment: 'fixed',
          position: 'relative',
          '&::before': {
            content: '""',
            position: 'absolute',
            top: 0,
            left: 0,
            right: 0,
            bottom: 0,
            backgroundColor: 'rgba(0, 0, 0, 0.5)',
            zIndex: 1,
          }
        }}
      >
        <Box
          sx={{
            zIndex: 2,
            position: 'absolute',
            bottom: '20%',
            left: '50%',
            transform: 'translateX(-50%)',
            textAlign: 'center'
          }}
        >
          <Fade in timeout={1000}>
            <Typography
              variant="h3"
              sx={{
                color: 'rgba(255, 255, 255, 0.6)',
                fontFamily: '"Arial", "Helvetica", sans-serif',
                fontWeight: 'bold',
                fontSize: { xs: '2.5rem', md: '3.5rem' },
                mb: 4,
                textShadow: '2px 2px 4px rgba(0,0,0,0.7)',
                fontStyle: 'italic',
                letterSpacing: '2px'
              }}
            >
              „Muzica e singura limbă pe care o înțeleg toți."
            </Typography>
          </Fade>
          <Fade in timeout={1500}>
            <Button
              component={Link}
              to="/contact"
              variant="contained"
              size="large"
              sx={{
                backgroundColor: '#ffffff',
                color: '#000000',
                fontWeight: 'bold',
                fontSize: '1.3rem',
                px: 6,
                py: 2,
                borderRadius: '50px',
                textTransform: 'uppercase',
                letterSpacing: '2px',
                boxShadow: '0 10px 30px rgba(0,0,0,0.4)',
                '&:hover': {
                  backgroundColor: '#f0f0f0',
                  transform: 'scale(1.08)',
                  boxShadow: '0 15px 40px rgba(0,0,0,0.5)',
                },
                transition: 'all 0.3s ease'
              }}
            >
              Contactează-mă
            </Button>
          </Fade>
        </Box>
      </Box>

      {/* Statistics Section */}
      <Box className="py-20 bg-gray-50">
        <Container maxWidth="lg">

          <Grid container spacing={12} justifyContent="center">
            {[
              {
                number: 875,
                label: 'CLIENȚI FERICIȚI'
              },
              {
                number: 346,
                label: 'NUNTI'
              },
              {
                number: 209,
                label: 'BOTEZURI'
              },
              {
                number: 125,
                label: 'EVENIMENTE CORPORATE'
              }
            ].map((stat, index) => (
              <Grid item xs={6} md={3} key={index}>
                <Fade in timeout={1000 + index * 200}>
                  <Box
                    className="text-center"
                    sx={{
                      position: 'relative',
                      py: 6,
                      px: 4,
                      '&:not(:last-child)::after': {
                        content: '""',
                        position: 'absolute',
                        right: { xs: 'auto', md: '-3rem' },
                        bottom: { xs: '-3rem', md: 'auto' },
                        left: { xs: '50%', md: 'auto' },
                        top: { xs: 'auto', md: '50%' },
                        transform: { xs: 'translateX(-50%)', md: 'translateY(-50%)' },
                        width: { xs: '80px', md: '2px' },
                        height: { xs: '2px', md: '80px' },
                        backgroundColor: '#cccccc'
                      }
                    }}
                  >
                    <Typography
                      variant="h2"
                      sx={{
                        fontSize: { xs: '2.5rem', md: '3rem' },
                        fontWeight: 'bold',
                        color: '#000000',
                        mb: 1
                      }}
                    >
                      <CounterAnimation
                        target={stat.number}
                        prefix={stat.prefix || ''}
                        duration={6000}
                      />
                    </Typography>
                    <Typography
                      variant="h6"
                      sx={{
                        color: '#666666',
                        fontWeight: 'bold',
                        letterSpacing: '1px'
                      }}
                    >
                      {stat.label}
                    </Typography>
                  </Box>
                </Fade>
              </Grid>
            ))}
          </Grid>
        </Container>
      </Box>


      {/* Reviews Carousel Section */}
      <ReviewsCarousel />
    </>
  );
};

export default Home;
